        return abs(a[0] - b[0]) + abs(a[1] - b[0])
    id_matrix = [[0 for _ in range(n)] for _ in range(n)]
    if m <= 10:
        for i in range(n):
            for j in range(n):
                flag = 0
                for charm in charms:
                    if dist([i, j], charm[:2]) <= charm[2]:
                        flag = 1
                        break
                if flag == 0:
                    grid[i][j] = -float('Inf')
    else:
        for charm in charms:
            for i in range(-charm[2], charm[2] + 1):
                appo = charm[2] - abs(i)
                for j in range(-appo, appo + 1):
                    x = i + charm[0]
                    y = j + charm[1]
                    if 0 <= x < n and 0 <= y < n:
                        id_matrix[x][y] = 1
        if id_matrix[0][0] == 0:
            grid[0][0] = -float('Inf')
        for i in range(1, n):
            if id_matrix[0][i] == 0:
                grid[0][i] = -float('Inf')
            else:
                grid[0][i] += grid[0][i - 1]
            if id_matrix[i][0] == 0:
                grid[i][0] = -float('Inf')
            else:
                grid[i][0] += grid[i - 1][0]
        for i in range(1, n):
            for j in range(1, n):
                if id_matrix[i][j] == 0:
                    grid[i][j] = -float('Inf')
                else:
                    grid[i][j] += max(grid[i - 1][j], grid[i][j - 1])
    if grid[n - 1][n - 1] < -10 ** 10:
        return ('NO', None)
    else:
        return ('YES', grid[n - 1][n - 1])

